package main

import "fmt"

func isValid(s string) bool {
	pair_map := map[string]string{
		"}": "{",
		")": "(",
		"]": "[",
	}
	var stack []string
  _, ok := pair_map[fmt.Sprintf("%c", s[0])]
  if ok {
    return false
  }
  if len(s) % 2 != 0 {
    return false
  }
	for i := 0; i < len(s); i++ {
		char := fmt.Sprintf("%c", s[i])
		_, ok := pair_map[char]
		if !ok {
			stack = append(stack, char)
			continue
		}
		pair := pair_map[char]
		if len(stack) == 0 {
			return false
		}
		if pair != stack[len(stack)-1] {
			return false
		} else {
			stack = stack[:len(stack)-1]
		}
	}
  if len(stack) > 0 {
    return false
  }
  return true
}

